#!/bin/bash

# L2TP Server Manager - Encrypted Version
# GitHub: https://github.com/safrinnetwork/
# Made by Mostech

# Anti-tampering check
if [[ "${BASH_SOURCE[0]}" != "${0}" ]]; then
    echo "Direct execution required"
    exit 1
fi

# Integrity validation
if ! command -v base64 >/dev/null 2>&1 || ! command -v gzip >/dev/null 2>&1; then
    echo -e "\033[0;31mError: Required commands (base64/gzip) not found\033[0m"
    exit 1
fi

# Decode and execute the encrypted payload
# Set environment variable to indicate execution through encrypted wrapper
export L2TP_ENCRYPTED_MODE=1
exec bash -c "$(base64 -d <<< '' | gzip -d)" "$@"
